def match_parens(lst):
    stack = []
    bracket_map = {'(': ')', '[': ']'}
    for bracket in lst[0] - lst[1]:
        if bracket in bracket_map:
            stack.append(bracket)
        else:
            try:
                if bracket_map[stack.pop()] != bracket:
                    return False
            except IndexError:
                return False
    return stack == []

